import { Component, Vue } from 'vue-property-decorator';
import Empty from '@/components/Empty/index.vue';
import {getDeviceResumeList,queryDeviceResumeById,queryDeviceById} from '@/api/device';

@Component({
  components: {
    Empty
  }
})
export default class DeviceRecord extends Vue {
  private deviceId = '';
  private deviceInfo: any = null;
  private eventType = '';
  private eventTime: any = [];
  private tableData: any[] = [];
  private counts = 0;
  private page = 1;
  private pageSize = 10;
  private isSearch = false;
  private detailDialog = false;
  private detailForm: any = {};
  private addDialog = false;
  private addForm: any = {
    deviceId: '',
    eventType: '',
    eventTime: '',
    eventDesc: ''
  };
  private rules = {
    eventType: [{ required: true, message: '请选择事件类型', trigger: 'change' }],
    eventTime: [{ required: true, message: '请选择事件时间', trigger: 'change' }]
  };

  created() {
    // 从路由参数获取设备ID
    this.deviceId = this.$route.query.deviceId as string;
    if (!this.deviceId) {
      this.$message.error('设备ID不能为空');
      this.goBack();
      return;
    }

    // 获取设备基本信息
    this.getDeviceInfo();

    // 初始化履历列表
    this.init();
  }

  private async getDeviceInfo() {
    const res = await queryDeviceById(this.deviceId);
    if (res.data.code === 1) {
      this.deviceInfo = res.data.data;
    }

  }

  private async init(isSearch?: boolean) {
    this.isSearch = isSearch === true;
    const params = {
      page: this.page,
      pageSize: this.pageSize,
      deviceId: this.deviceId,
      eventType: this.eventType || undefined,
      beginTime: this.eventTime && this.eventTime.length > 0 ? this.eventTime[0] : undefined,
      endTime: this.eventTime && this.eventTime.length > 0 ? this.eventTime[1] : undefined
    };
    const res = await getDeviceResumeList(params);
    if (res.data.code === 1) {
      this.tableData = res.data.data.records;
      this.counts = res.data.data.total;
    }

  }

  private async viewDetail(row: any) {
    try {
    const res = await queryDeviceResumeById(row.resumeId);
    if (res.data.code === 1) {
      this.detailForm = res.data.data;
    } else {
      this.$message.error(res.data.msg || '获取设备履历详情失败');
    }

    // 显示详情对话框
    this.detailDialog = true;
  } catch (error) {
    console.error('获取设备履历详情失败:', error);
    this.$message.error('获取设备履历详情失败,请重试');
    // 出错时仍然显示基本信息
    this.detailForm = { ...row };
    this.detailDialog = true;
  }
  }

  private handleClose() {
    this.detailDialog = false;
  }


  private handleAddClose() {
    this.addDialog = false;
  }


  private getEventTypeText(type: number) {
    const typeMap: { [key: number]: string } = {
      1: '采购',
      2: '出库安装',
      3: '维修',
      4: '保养',
      5: '检测',
      6: '巡检',
      7: '变更',
      8: '报废'
    };
    return typeMap[type] || '未知';
  }

  private goBack() {
    this.$router.push('/director/device');
  }

  private handleSizeChange(val: number) {
    this.pageSize = val;
    this.init();
  }

  private handleCurrentChange(val: number) {
    this.page = val;
    this.init();
  }
}
